// Login.js

import React, { useState } from 'react';
import styles from './Login.module.css'; // Import styles from Login.module.css

const Login = ({ onLogin }) => {
  const [isLoginActive, setIsLoginActive] = useState(true);

  const handleToggle = () => {
    setIsLoginActive(!isLoginActive);
  };

  const handleLoginClick = () => {
    // Additional login logic can be added here
    onLogin();
  };

  return (
    <div className={`${styles.container} ${isLoginActive ? '' : styles.moveUp}`}>
      <div className={styles.formContainerSignIn}>
        <form>
          <h1>Sign In</h1>
          <input type="text" placeholder="Username" />
          <input type="password" placeholder="Password" />
          <button onClick={handleLoginClick}>Sign In</button>
        </form>
      </div>
    </div>
  );
}

export default Login;
